int main(int argc,char *argv[])
{
  try
  {

    glsCommandLine::Instance()->ReadCommandLine(argc,argv);

    gLStudio_Cdu = new GLStudio_CduClass("GLStudio-Cdu",441,507);
    gLStudio_Cdu->CreateObjects();

//////////////////// User Code from section: "Main Initialization" ////////////
///////////////////////////////////////////////////////////////////////////////
    gLStudio_Cdu->SetRedraw();

    Timer frameTimer;
    do
    {
//////////////////// User Code from section: "Main Loop" //////////////////////
///////////////////////////////////////////////////////////////////////////////
        gLStudio_Cdu->RecordCalculateStart();
        gLStudio_Cdu->Calculate(frameTimer.ElapsedSecondsDouble());
        gLStudio_Cdu->RecordCalculateEnd();
    }
    while(gLStudio_Cdu->FrameAnimate());

    // Delete the instance
    delete gLStudio_Cdu;

  }
  catch(DistiException e)
  {
    Error(e.what());
  }
  return 0;
}
